 CREATE PROC [dbo].[zDP_UPR40202L_1] (@SETUPKEY_RS smallint, @SETUPKEY_RE smallint) AS  set nocount on IF @SETUPKEY_RS IS NULL BEGIN SELECT TOP 25  SETUPKEY, ASGMTPRTY_1, ASGMTPRTY_2, ASGMTPRTY_3, ASGMTPRTY_4, ASGMTPRTY_5, ASGMTPRTY_6, ASGMTPRTY_7, ASGMTPRTY_8, ASGMTPRTY_9, ASGMTPRTY_10, DEX_ROW_ID FROM .UPR40202 ORDER BY SETUPKEY DESC END ELSE IF @SETUPKEY_RS = @SETUPKEY_RE BEGIN SELECT TOP 25  SETUPKEY, ASGMTPRTY_1, ASGMTPRTY_2, ASGMTPRTY_3, ASGMTPRTY_4, ASGMTPRTY_5, ASGMTPRTY_6, ASGMTPRTY_7, ASGMTPRTY_8, ASGMTPRTY_9, ASGMTPRTY_10, DEX_ROW_ID FROM .UPR40202 WHERE SETUPKEY = @SETUPKEY_RS ORDER BY SETUPKEY DESC END ELSE BEGIN SELECT TOP 25  SETUPKEY, ASGMTPRTY_1, ASGMTPRTY_2, ASGMTPRTY_3, ASGMTPRTY_4, ASGMTPRTY_5, ASGMTPRTY_6, ASGMTPRTY_7, ASGMTPRTY_8, ASGMTPRTY_9, ASGMTPRTY_10, DEX_ROW_ID FROM .UPR40202 WHERE SETUPKEY BETWEEN @SETUPKEY_RS AND @SETUPKEY_RE ORDER BY SETUPKEY DESC END set nocount off    
